import React from "react";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import { publicRoutes } from './routes'

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          {
            publicRoutes.map(
              (route, index) => {
                return <Route key={index} path={route.path} Component={route.component} />
              }
            )
          }
        </Routes>
      </div>
    </Router>
  );
}

export default App;
